import React from "react";
import "./body_cart.css";
import { useState, useEffect } from "react";
import axios from "axios";

const Body_cart = () => {
  const [showApi, setShowApI] = useState([]);

  useEffect(() => {
    axios
      .get("https://fakestoreapi.com/products")
      .then((res) => {
        setShowApI(res.data);
      })
      .catch((err) => console.log(err));
  }, []);

  return (
    <div className="data_container">
      <div className="card_container">
        {showApi.map((showdata) => {
          return (
            <div className="data_div" key={showdata.id}>
              <div className="data_card">
                <img src={showdata.image} />
              </div>
              <div>
                <h5>{showdata.title}</h5>
                <span>{showdata.category}</span>
              </div>
              <div style={{minWidth:"20px", minHeight:"20px"}}>
                    <p >{showdata.description}</p>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Body_cart;
